import React, { Component } from "react";

export class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username: "",
      password: "",
    };
  }

  render() {
    return (
      <div className="box box -- small">
        <label>Username</label>
        <input type="text" />
        <br />
        <label>Password</label>
        <input type="text" />
        <br />
        <button>Login</button>
        <h1>No account?</h1>
        <br />
        <label>Username</label>
        <input type="text" />
        <br />
        <label>Password</label>
        <input type="text" />
        <br />
        <button>Sign up!</button>
      </div>
    );
  }
}
